oFF.AuExportManager = function() {};
oFF.AuExportManager.prototype = new oFF.XObject();
oFF.AuExportManager.prototype._ff_c = "AuExportManager";

oFF.AuExportManager.create = function(controller, exportDialogConfig)
{
	let manager = new oFF.AuExportManager();
	manager._setupInternal(controller, exportDialogConfig);
	return manager;
};
oFF.AuExportManager.prototype.m_controller = null;
oFF.AuExportManager.prototype.m_dataProvider = null;
oFF.AuExportManager.prototype.m_exportDialogConfig = null;
oFF.AuExportManager.prototype._getContent = function()
{
	let createFilePromise = this.m_controller.executeAction(oFF.AuDaContentHandlerCommandPlugin.PLUGIN_NAME, oFF.AuDaContentHandlerCommandPlugin.CMD_CREATE_FILE_FROM_DP, this.m_dataProvider);
	return createFilePromise.onThenExt((content) => {
		return content;
	});
};
oFF.AuExportManager.prototype._getDocumentTitle = function()
{
	let documentTitle = null;
	let queryModel = this._getQueryModel();
	if (oFF.notNull(queryModel))
	{
		documentTitle = queryModel.getUiNameWithFallback();
		if (oFF.XStringUtils.isNullOrEmpty(documentTitle))
		{
			documentTitle = queryModel.getName();
		}
	}
	return documentTitle;
};
oFF.AuExportManager.prototype._getQueryModel = function()
{
	let queryManager = this.m_dataProvider.getQueryManager();
	return oFF.notNull(queryManager) ? queryManager.getQueryModel() : null;
};
oFF.AuExportManager.prototype._getTableDefinition = function()
{
	let queryModel = this._getQueryModel();
	if (oFF.notNull(queryModel))
	{
		return queryModel.getVisualizationManager().getDefaultTableDefinition();
	}
	return null;
};
oFF.AuExportManager.prototype._loadExportConfig = function(exportDialogRunner, exportType)
{
	if (oFF.notNull(this.m_exportDialogConfig))
	{
		if (this.m_exportDialogConfig.getStructureByKey(oFF.BaseExportConfig.CSV_EXPORT) !== null && oFF.XString.isEqual(oFF.BaseExportConfig.CSV_EXPORT, exportType))
		{
			let csvDialogConfig = this.m_exportDialogConfig.getStructureByKey(oFF.BaseExportConfig.CSV_EXPORT);
			exportDialogRunner.setStringArgument(oFF.CsvConfig.CSV_DELIM_KEY, csvDialogConfig.getStringByKeyExt(oFF.CsvConfig.CSV_DELIM_KEY, oFF.CsvConfig.CSV_DEFAULT_DELIM));
			exportDialogRunner.setBooleanArgument(oFF.CsvConfig.CSV_SKIP_FORMATTING, csvDialogConfig.getBooleanByKeyExt(oFF.CsvConfig.CSV_SKIP_FORMATTING, oFF.CsvConfig.CSV_SKIP_FORMATTING_DEFAULT));
			this._loadRepetitiveMemberNames(exportDialogRunner, csvDialogConfig);
		}
		if (this.m_exportDialogConfig.getStructureByKey(oFF.BaseExportConfig.XLSX_EXPORT) !== null && oFF.XString.isEqual(oFF.BaseExportConfig.XLSX_EXPORT, exportType))
		{
			let xlsxDialogConfig = this.m_exportDialogConfig.getStructureByKey(oFF.BaseExportConfig.XLSX_EXPORT);
			exportDialogRunner.setBooleanArgument(oFF.BaseExportConfig.PARAM_EXPAND_HIERARCHY, xlsxDialogConfig.getBooleanByKeyExt(oFF.BaseExportConfig.PARAM_EXPAND_HIERARCHY, false));
			exportDialogRunner.setBooleanArgument(oFF.BaseExportConfig.PARAM_CREATE_SHORTCUT_FOR_APPENDIX, xlsxDialogConfig.getBooleanByKeyExt(oFF.BaseExportConfig.PARAM_CREATE_SHORTCUT_FOR_APPENDIX, false));
			this._loadRepetitiveMemberNames(exportDialogRunner, xlsxDialogConfig);
		}
		if (this.m_exportDialogConfig.getStructureByKey(oFF.BaseExportConfig.PDF_EXPORT) !== null && oFF.XString.isEqual(oFF.BaseExportConfig.PDF_EXPORT, exportType))
		{
			let pdfDialogConfig = this.m_exportDialogConfig.getStructureByKey(oFF.BaseExportConfig.PDF_EXPORT);
			exportDialogRunner.setStringArgument(oFF.PdfConfig.PDF_PAGE_ORIENT_KEY, pdfDialogConfig.getStringByKeyExt(oFF.PdfConfig.PDF_PAGE_ORIENT_KEY, oFF.PdfConfig.PDF_ORIENT_LANDSCAPE));
			exportDialogRunner.setStringArgument(oFF.PdfConfig.PDF_PAGE_SIZE_KEY, pdfDialogConfig.getStringByKeyExt(oFF.PdfConfig.PDF_PAGE_SIZE_KEY, oFF.PdfConfig.PAGE_SIZE_A4));
			exportDialogRunner.setBooleanArgument(oFF.PdfConfig.PDF_FIT_TABLE_TO_PAGE_WIDTH, pdfDialogConfig.getBooleanByKeyExt(oFF.PdfConfig.PDF_FIT_TABLE_TO_PAGE_WIDTH, false));
			exportDialogRunner.setStringArgument(oFF.PdfConfig.PDF_PAGE_NUM_LOC_KEY, pdfDialogConfig.getStringByKeyExt(oFF.PdfConfig.PDF_PAGE_NUM_LOC_KEY, oFF.PdfConfig.PAGE_NUMBER_LOC_NONE));
			exportDialogRunner.setBooleanArgument(oFF.PdfConfig.PDF_APPENDIX_KEY, pdfDialogConfig.getBooleanByKeyExt(oFF.PdfConfig.PDF_APPENDIX_KEY, false));
			if (pdfDialogConfig.containsKey(oFF.PdfConfig.PDF_APPENDIX_KEY_USER_SELECTED))
			{
				exportDialogRunner.setBooleanArgument(oFF.PdfConfig.PDF_APPENDIX_KEY, pdfDialogConfig.getBooleanByKeyExt(oFF.PdfConfig.PDF_APPENDIX_KEY_USER_SELECTED, false));
			}
			this._loadRepetitiveMemberNames(exportDialogRunner, pdfDialogConfig);
		}
	}
};
oFF.AuExportManager.prototype._loadRepetitiveMemberNames = function(exportDialogRunner, exportTypeCfg)
{
	if (exportTypeCfg.containsKey(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS_USER_SELETED))
	{
		let tableDefinition = this._getTableDefinition();
		let showRepMembers = oFF.notNull(tableDefinition) && tableDefinition.isRepetitiveMemberNames();
		exportDialogRunner.setBooleanArgument(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS, exportTypeCfg.getBooleanByKeyExt(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS_USER_SELETED, showRepMembers));
	}
};
oFF.AuExportManager.prototype._persistExportConfig = function(exportConfig)
{
	if (oFF.isNull(this.m_exportDialogConfig))
	{
		this.m_exportDialogConfig = oFF.PrFactory.createStructure();
	}
	let exportTypeCfg = this.m_exportDialogConfig.getStructureByKey(exportConfig.getType());
	if (oFF.isNull(exportTypeCfg))
	{
		exportTypeCfg = this.m_exportDialogConfig.putNewStructure(exportConfig.getType());
	}
	exportConfig.populatePersistentStorage(exportTypeCfg);
	this._persistRepetitiveMemberNames(exportTypeCfg, exportConfig);
	return this.m_exportDialogConfig;
};
oFF.AuExportManager.prototype._persistRepetitiveMemberNames = function(exportTypeCfg, exportConfig)
{
	let dlgSetting = exportConfig.getShowRepetitiveMembers();
	if (exportTypeCfg.containsKey(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS_USER_SELETED))
	{
		exportTypeCfg.putBoolean(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS_USER_SELETED, dlgSetting);
	}
	else if (!exportTypeCfg.containsKey(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS_USER_SELETED))
	{
		let tableDefinition = this._getTableDefinition();
		let showRepMembers = oFF.notNull(tableDefinition) && tableDefinition.isRepetitiveMemberNames();
		if (showRepMembers !== dlgSetting)
		{
			exportTypeCfg.putBoolean(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS_USER_SELETED, dlgSetting);
		}
	}
};
oFF.AuExportManager.prototype._setupInternal = function(controller, exportDialogConfig)
{
	this.setup();
	this.m_controller = controller;
	this.m_exportDialogConfig = exportDialogConfig;
};
oFF.AuExportManager.prototype.canExportData = function(actionId)
{
	let queryModel = this._getQueryModel();
	if (oFF.notNull(queryModel))
	{
		let visualizationManager = queryModel.getVisualizationManager();
		if (oFF.notNull(visualizationManager))
		{
			let currentVisualizationDefinition = visualizationManager.getCurrentActiveVisualizationDefinition();
			let isTableViewActive = oFF.notNull(currentVisualizationDefinition) && currentVisualizationDefinition.getSemanticBindingType() === oFF.SemanticBindingType.TABLE;
			let isPdfExport = oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_EXPORT_PDF);
			return (isTableViewActive || !isPdfExport) && (!queryModel.isDataExportRestricted() || isPdfExport);
		}
	}
	return false;
};
oFF.AuExportManager.prototype.exportData = function(exportType, exportConfig)
{
	let tableDefinition = this._getTableDefinition();
	if (oFF.notNull(exportConfig))
	{
		let onComplete = (result) => {
			let notificationData = oFF.XNotificationData.create();
			notificationData.putXObject(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_EXPORT_RESULT, result);
			this.m_controller.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DOCUMENT_EXPORTED, notificationData);
		};
		let onError = (msg) => {
			this.m_controller.addErrorMessage(oFF.Severity.ERROR.getName(), "Export error", msg);
		};
		let dataExportHelper = oFF.DataExportHelper.create(this.m_dataProvider.getQueryManager(), tableDefinition, onError, onComplete);
		dataExportHelper.exportData(exportConfig);
	}
	else
	{
		let okHandler = (config) => {
			this.m_controller.setBusy(true);
			if (this.m_dataProvider.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.ORCA))
			{
				config.setDefaultDatasourceName(this._getDocumentTitle());
			}
			let onError = (msg) => {
				this.m_controller.setBusy(false);
				this.m_controller.addErrorMessage(oFF.Severity.ERROR.getName(), "Export error", msg);
			};
			let onComplete = (result) => {
				this.m_controller.setBusy(false);
				if (result.success())
				{
					if (result.hasWarnings())
					{
						let warning = oFF.DataExportHelper.getDisplayMessageFromResult(result);
						this.m_controller.getGenesis().showWarningToast(warning);
						this.m_controller.addWarningMessage(oFF.Severity.WARNING.getName(), "Export warning", warning);
					}
					else
					{
						let successMsg = oFF.XLocalizationCenter.getCenter().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.MSG_EXPORT_DATA_SUCCESS, config.getFileName());
						this.m_controller.getGenesis().showSuccessToast(successMsg);
						this.m_controller.addSuccessMessage(oFF.Severity.INFO.getName(), "Export success", successMsg);
						oFF.AuUsageTracking.trackExportUsage(this.m_controller.getProcess(), exportType, this.m_dataProvider.getQueryManager().getSystemType(), config);
					}
					let exportDialogConfig = this._persistExportConfig(config);
					let notificationData = oFF.XNotificationData.create();
					notificationData.putString(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_EXPORT_CONTENT_TYPE, config.getType());
					notificationData.putXObject(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_EXPORT_USER_CHOICES, exportDialogConfig);
					this.m_controller.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_EXPORT_DOCUMENT, notificationData);
				}
			};
			if (config.getSupportsShortcutLinkforAppendix() && config.getCreateShortcutLinkforAppendix())
			{
				this.saveAndCreateShortcutlink().onThen((shortcutFileLocation) => {
					config.setShortcutUrl(shortcutFileLocation);
					let dataExportHelper = oFF.DataExportHelper.create(this.m_dataProvider.getQueryManager(), tableDefinition, onError, onComplete);
					dataExportHelper.exportData(config);
				});
			}
			else
			{
				let dataExportHelper = oFF.DataExportHelper.create(this.m_dataProvider.getQueryManager(), tableDefinition, onError, onComplete);
				dataExportHelper.exportData(config);
			}
		};
		let showRepMembers = oFF.notNull(tableDefinition) && tableDefinition.isRepetitiveMemberNames();
		let exportDialogRunner = oFF.ProgramRunner.createRunner(this.m_controller.getProcess(), oFF.SuExportDialog.DEFAULT_PROGRAM_NAME);
		exportDialogRunner.setStringArgument(oFF.SuExportDialog.PARAM_EXPORT_TYPE, exportType);
		exportDialogRunner.setStringArgument(oFF.SuExportDialog.PARAM_FILE_NAME, this._getDocumentTitle());
		exportDialogRunner.setBooleanArgument(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS, showRepMembers);
		this._loadExportConfig(exportDialogRunner, exportType);
		exportDialogRunner.runProgram().onThenExt((dialog) => {
			let expDialog = dialog;
			expDialog.setOkHandler(okHandler);
			return expDialog;
		}).onCatch((error) => {
			this.m_controller.getMessageCenter().showErrorToast(error.getText());
		});
	}
};
oFF.AuExportManager.prototype.generateUrlWhenOpenedFromShortcut = function(url)
{
	let shortcutId = this.getShortcutId(url);
	let location = oFF.NetworkEnv.getLocation();
	let shortcutFileLocation = oFF.XUri.createFromOther(location);
	let newFragment = oFF.XStringUtils.concatenate2(oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT, shortcutId);
	shortcutFileLocation.setFragment(newFragment);
	return shortcutFileLocation.getUrl();
};
oFF.AuExportManager.prototype.getShortcutId = function(shortcutUrl)
{
	let retVal;
	if (oFF.XString.containsString(shortcutUrl, oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT))
	{
		if ((retVal = oFF.XString.indexOf(shortcutUrl, oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT)) !== -1)
		{
			let newIndex = retVal + oFF.XString.size(oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT);
			return oFF.XString.substring(shortcutUrl, newIndex, -1);
		}
	}
	return "";
};
oFF.AuExportManager.prototype.hasStateChanges = function()
{
	return this.m_controller.getGlobalDataSpace().getBooleanByKey(oFF.AuPluginManager.DATA_SPACE_IS_DOCUMENT_DIRTY);
};
oFF.AuExportManager.prototype.isShortcutUrl = function(openingUrl)
{
	if (oFF.XString.containsString(openingUrl, oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT))
	{
		return true;
	}
	else
	{
		return false;
	}
};
oFF.AuExportManager.prototype.releaseObject = function()
{
	this.m_controller = null;
	this.m_dataProvider = null;
	this.m_exportDialogConfig = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuExportManager.prototype.saveAndCreateShortcutlink = function()
{
	return oFF.XPromise.create((resolve, reject) => {
		let openingUrl = this.m_dataProvider.getQueryManager().getQueryModel().getApplication().getSession().getNetworkLocation().getUrl();
		if (this.isShortcutUrl(openingUrl) && !this.hasStateChanges())
		{
			openingUrl = this.generateUrlWhenOpenedFromShortcut(openingUrl);
			if (!oFF.XStringUtils.isNullOrEmpty(openingUrl))
			{
				resolve(oFF.XUri.createFromUrl(openingUrl));
			}
		}
		else
		{
			let process = this.m_controller.getProcess();
			let shortcutDirectoryFilePath = process.getKernel().getKernelProcess().getEnvironment().resolvePath(oFF.SuQuickAccessShareDialogConstants.SHORTCUT_DIRECTORY_DEFAULT_PATH);
			let root = process.getRootDirectoryUri().getUrl();
			let filePath = oFF.XStringUtils.concatenate3(root, shortcutDirectoryFilePath, oFF.SuQuickAccessShareDialogConstants.NEW_SHORTCUT);
			this._getContent().onThen((contentToSave) => {
				let shortcutFile = oFF.XFile.createWithVars(process, filePath);
				oFF.XFilePromise.saveContent(shortcutFile, contentToSave).onThen((savedShortcutFile) => {
					if (oFF.notNull(savedShortcutFile) && savedShortcutFile.getCachedMetadata() !== null && savedShortcutFile.getCachedMetadata().containsKey(oFF.XFileAttribute.UNIQUE_ID))
					{
						let location = oFF.NetworkEnv.getLocation();
						let shortcutFileLocation = oFF.XUri.createFromOther(location);
						let shortcutId = savedShortcutFile.getCachedMetadata().getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
						let newFragment = oFF.XStringUtils.concatenate2(oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT, shortcutId);
						shortcutFileLocation.setFragment(newFragment);
						resolve(shortcutFileLocation);
						oFF.AuUsageTracking.recordShortcutCreation(process);
					}
				});
			}).onCatch((errorMsg) => {
				resolve(null);
			}).onFinally(() => {
				oFF.XLogger.println("saveAndCreateShortcutlink: \tshortcut Creation Finally...");
			});
		}
	});
};
oFF.AuExportManager.prototype.setDataProvider = function(dataProvider)
{
	this.m_dataProvider = dataProvider;
};

oFF.AuInsightShareManager = function() {};
