oFF.AuVariableManager.prototype.m_showEmptyLoadingPageProcedure = null;
oFF.AuVariableManager.prototype.m_stopOnCancel = false;
oFF.AuVariableManager.prototype._getVariableDialogPromise = function()
{
	return oFF.XPromise.create((resolve, reject) => {
		this._openVariableDialogWithDp(resolve, reject);
	});
};
oFF.AuVariableManager.prototype._getVariableDialogTitle = function()
{
	let niceTitle = oFF.AuSfxJsonUtils.getModelDisplayName(this.m_dataProvider);
	if (oFF.XStringUtils.isNullOrEmpty(niceTitle))
	{
		niceTitle = oFF.AuDaQueryManagerUtils.getQueryName(this.m_dataProvider.getQueryManager());
	}
	return niceTitle;
};
oFF.AuVariableManager.prototype._isEmptyMandatoryVariableExisting = function()
{
	if (!this.m_hasInputEnabledVariables)
	{
		return false;
	}
	let variables = this.m_dataProvider.getQueryManager().getInputEnabledAndNonTechnicalVariables();
	return oFF.XCollectionUtils.contains(variables, (variable) => {
		return variable.isMandatory() && variable.isEmpty();
	});
};
oFF.AuVariableManager.prototype._isInitialVariableDialogNecessary = function()
{
	if (!this.m_hasInputEnabledVariables)
	{
		return false;
	}
	let hasInaRepoJson = this.m_dataProvider.getConnection().getRepoJson() !== null;
	let isRri = oFF.AuDaQueryManagerUtils.isRriJumpTarget(this.m_dataProvider.getQueryManager());
	return !hasInaRepoJson && !isRri;
};
oFF.AuVariableManager.prototype._openVariableDialogWithDp = function(resolve, reject)
{
	let title = oFF.XLocalizationCenter.getCenter().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.DIALOG_VARIABLE_WITH_PLACEHOLDER, this._getVariableDialogTitle());
	oFF.OuDataProviderOlapUiActionsCollection.getOlapUiActions(this.m_dataProvider).openVariableDialog(title, null).onThen((result) => {
		if (result.isDialogCancelled())
		{
			if (oFF.isNull(this.m_controller) || this.m_stopOnCancel)
			{
				resolve(oFF.XBooleanValue.create(false));
			}
			else
			{
				this._showVariablesNotSetView(() => {
					this._openVariableDialogWithDp(resolve, reject);
				});
			}
		}
		else
		{
			if (oFF.notNull(this.m_showEmptyLoadingPageProcedure))
			{
				this.m_showEmptyLoadingPageProcedure();
			}
			resolve(oFF.XBooleanValue.create(true));
		}
	}).onCatch(reject);
};
