oFF.AuDaDocumentActionsRegistrator.prototype.releaseObject = function()
{
	this.m_i18nProvider = null;
	this.m_registry = oFF.XObjectExt.release(this.m_registry);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuDaDocumentActionsRegistrator.prototype.replaceRriParameters = function(sourceString, targetDataSource, systemDescription)
{
	let result = sourceString;
	if (oFF.notNull(result))
	{
		result = oFF.XString.replace(result, "{DATASOURCE_FQN}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getFullQualifiedName()));
		result = oFF.XString.replace(result, "{DATASOURCE_NAME}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getObjectName()));
		result = oFF.XString.replace(result, "{SYSTEM_CONNECTION}", oFF.XHttpUtils.encodeURIComponent(systemDescription.getSystemName()));
		result = oFF.XString.replace(result, "{SYSTEM_TYPE}", oFF.XHttpUtils.encodeURIComponent(systemDescription.getSystemType().getName()));
		result = oFF.XString.replace(result, "{RRINAME}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getRriName()));
		result = oFF.XString.replace(result, "{RRIVALUE}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getRriValue()));
	}
	return result;
};
oFF.AuDaDocumentActionsRegistrator.prototype.selectTarget = function(selectedTarget, queryModel, dataApplication)
{
	let targetUrl = selectedTarget.getTargetUrl();
	let targetDataSource = selectedTarget.getDataSource();
	if (oFF.notNull(targetDataSource))
	{
		targetUrl = this.getRriJumpTarget(targetDataSource, queryModel, dataApplication);
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(targetUrl))
	{
		oFF.UiFramework.currentFramework().openUrl(targetUrl, "_blank");
	}
};

