oFF.AuDaResourceExplorerConfig.prototype.addExtensionQuickAccessItem = function(extension, quickAccessItem)
{
	if (oFF.isNull(quickAccessItem))
	{
		throw oFF.XException.createIllegalArgumentException("quickAccess must not be null");
	}
	let quickAccessPath = oFF.XStringUtils.concatenate3("$.ext.['", extension, "'].quickAccess");
	let quickAccess = this.getProperty(quickAccessPath);
	if (oFF.isNull(quickAccess))
	{
		quickAccess = oFF.PrList.create();
		this.setProperty(quickAccessPath, quickAccess);
	}
	if (!quickAccess.isList())
	{
		let message = "Expected quick access to be an array";
		throw oFF.XException.createIllegalStateException(message);
	}
	quickAccess.asList().add(quickAccessItem);
};
oFF.AuDaResourceExplorerConfig.prototype.addExtensionResourceMap = function(extension, resourceMap)
{
	let path = oFF.XStringUtils.concatenate3("$.ext.['", extension, "'].resourceMap");
	this.addToResourceMap(path, resourceMap, "path", "alias");
};
oFF.AuDaResourceExplorerConfig.prototype.addLastSavedConnectionInfo = function(system, connection)
{
	let datasourcePath = "$.config.datasource";
	let datasource = this.getProperty(datasourcePath);
	if (oFF.isNull(datasource))
	{
		datasource = oFF.PrStructure.create();
	}
	let datasourceStruct = datasource.asStructure();
	datasourceStruct.putString("system", system);
	datasourceStruct.putString("connection", connection);
};
oFF.AuDaResourceExplorerConfig.prototype.addResourceMap = function(resourceMap)
{
	this.addToResourceMap("$.config.resourceMap", resourceMap, "name", "display");
};
oFF.AuDaResourceExplorerConfig.prototype.addSystemType = function(systemType)
{
	let systemTypesPath = "$.config.datasource.systemTypes";
	let systemTypes = this.getProperty(systemTypesPath);
	if (oFF.isNull(systemTypes))
	{
		systemTypes = oFF.PrList.create();
		this.setProperty(systemTypesPath, systemTypes);
	}
	else if (!systemTypes.isList())
	{
		let message = "Expected systemTypes to be an array";
		throw oFF.XException.createIllegalStateException(message);
	}
	let systemTypesList = systemTypes.asList();
	let newString = oFF.PrString.createWithValue(systemType);
	if (!systemTypesList.contains(newString))
	{
		systemTypesList.add(newString);
	}
};
oFF.AuDaResourceExplorerConfig.prototype.addToResourceMap = function(resourceMapPath, resourceMap, keyLabel, valueLabel)
{
	let resourceMapElement = this.getProperty(resourceMapPath);
	if (oFF.isNull(resourceMapElement))
	{
		resourceMapElement = oFF.PrList.create();
		this.setProperty(resourceMapPath, resourceMapElement);
	}
	else if (!resourceMapElement.isList())
	{
		let message = "Expected resourceMap to be an array";
		throw oFF.XException.createIllegalStateException(message);
	}
	let resourceList = resourceMapElement.asList();
	oFF.XStream.ofString(resourceMap.getKeysAsReadOnlyList()).forEach((ixKey) => {
		let key = ixKey.getString();
		let value = resourceMap.getStringByKey(key);
		let query = oFF.XStringUtils.concatenate5("[?(@.", keyLabel, "=='", key, "')]");
		let existingPath = oFF.XStringUtils.concatenate2(resourceMapPath, query);
		let mapping = this.getProperty(existingPath);
		if (oFF.notNull(mapping))
		{
			mapping.asStructure().putString(valueLabel, value);
		}
		else
		{
			let newMapping = oFF.PrStructure.create();
			newMapping.putString(keyLabel, key);
			newMapping.putString(valueLabel, value);
			resourceList.add(newMapping);
		}
	});
};

