oFF.AuDaToolbarConfig.prototype.getShareItemOrder = function(actionName)
{
	if (oFF.isNull(oFF.AuDaToolbarConfig.SHARE_ITEMS_ORDER))
	{
		oFF.AuDaToolbarConfig.SHARE_ITEMS_ORDER = oFF.XSimpleMap.create();
		oFF.AuDaToolbarConfig.SHARE_ITEMS_ORDER.put(oFF.XStringValue.create("Document.Insight.Share"), oFF.XIntegerValue.create(0));
		oFF.AuDaToolbarConfig.SHARE_ITEMS_ORDER.put(oFF.XStringValue.create("Document.Sac.Shortcut"), oFF.XIntegerValue.create(1));
		oFF.AuDaToolbarConfig.SHARE_ITEMS_ORDER.put(oFF.XStringValue.create("Document.Schedule.Publication"), oFF.XIntegerValue.create(2));
	}
	let order = oFF.AuDaToolbarConfig.SHARE_ITEMS_ORDER.getByKey(oFF.XStringValue.create(actionName));
	return oFF.isNull(order) ? 100 : order.getInteger();
};
