oFF.AuDaToolbarConfig.prototype.sortShareMenuActions = function(shareMenu)
{
	let actions = shareMenu.getListByKey("Items");
	let sortedActionList = actions.getReadOnlyList().createListCopy();
	sortedActionList.sortByComparator(oFF.XComparatorLambda.create((action1, action2) => {
		if (oFF.isNull(action1) && oFF.isNull(action2))
		{
			return oFF.XIntegerValue.create(0);
		}
		if (oFF.isNull(action1))
		{
			return oFF.XIntegerValue.create(-1);
		}
		let name1 = action1.asStructureReadOnly().getStringByKey("Action");
		let name2 = action2.asStructureReadOnly().getStringByKey("Action");
		let result = this.getShareItemOrder(name1) - this.getShareItemOrder(name2);
		return oFF.XIntegerValue.create(result);
	}));
	actions.clear();
	oFF.XStream.of(sortedActionList).forEach((action) => {
		actions.add(oFF.PrStructure.createDeepCopy(action.asStructureReadOnly()));
	});
};

