oFF.AuDataAnalyzerExternalApi.create = function(program)
{
	if (oFF.isNull(program))
	{
		oFF.XException.createException("A horizon program instance is required to initialize DataAnalyzerExternalApi!");
		return null;
	}
	let dataSourceSupplier = (dataProviderName) => {
		let dataSource = null;
		let dpPool = program.getProcess().getDataProviderPool();
		let dp = dpPool.getDataProviderByName(dataProviderName);
		if (oFF.XObjectExt.isValidObject(dp))
		{
			dataSource = dp.getQueryManager().getDataSource();
		}
		return dataSource;
	};
	return oFF.AuDataAnalyzerExternalApi.createExt(program, program, program.getDataSpace(), dataSourceSupplier, program.getMessageManager());
};
oFF.AuDataAnalyzerExternalApi.createExt = function(localNotifications, commandExecutor, dataSpace, dataSourceSupplier, messageManager)
{
	let api = new oFF.AuDataAnalyzerExternalApi();
	api.setupExt(localNotifications, commandExecutor, dataSpace, dataSourceSupplier, messageManager);
	return api;
};
