oFF.AuDataAnalyzerExternalApi.prototype._fireDataSourceChanged = function(dataSource)
{
	if (oFF.notNull(dataSource))
	{
		oFF.XCollectionUtils.forEach(this.m_datasourceChangedCallbacks, (callback) => {
			callback(dataSource);
		});
	}
};
oFF.AuDataAnalyzerExternalApi.prototype._getDatasetId = function(dataProvider)
{
	if (oFF.XObjectExt.isValidObject(dataProvider))
	{
		let queryManager = dataProvider.getQueryManager();
		if (oFF.XObjectExt.isValidObject(queryManager))
		{
			let queryModel = queryManager.getQueryModel();
			if (oFF.XObjectExt.isValidObject(queryModel))
			{
				return queryModel.getDatasetId();
			}
		}
	}
	return null;
};
oFF.AuDataAnalyzerExternalApi.prototype._observeNotification = function(name, consumer)
{
	let uuid = this.m_localNotifications.addObserverForName(name, consumer);
	this.m_observerUuids.add(uuid);
};
oFF.AuDataAnalyzerExternalApi.prototype._observeNotifications = function()
{
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DIRTY_STATE_CHANGED, this._onDirtyStateChanged.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_UI_STATE_CHANGED, this._onUiStateChanged.bind(this));
	this._observeNotification(oFF.AuDaLandingPageViewPlugin.NOTIFICATION_LEARN_MORE_LINK_CLICKED, this._onLearnMoreClicked.bind(this));
	this._observeNotification(oFF.AuDaLandingPageViewPlugin.NOTIFICATION_WELCOME_DIALOG_CLOSED, this._onWelcomeDialogClosed.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DP_CHANGED, this._onDataSourceChanged.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATASOURCE_PICKED, this._onDataSourcePicked.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_INSIGHT_SAVED, this._onInsightSaved.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_LANDING_PAGE_OPENED, this._onLandingPageOpened.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DOCUMENT_READY, this._onDocumentReady.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_SHORTCUT_EXPLANATORY_DIALOG_CLOSED, this._onShortcutExplanatoryDialogClosed.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_EXPORT_DOCUMENT, this._onDocumentExport.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_EXPORTABLE_DOCUMENT_READY, this._onExportableDocumentReady.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DOCUMENT_EXPORTED, this._onDocumentExported.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_SCHEDULE_PUBLICATION_DIALOG_CLOSED, this._onSchedulePublicationDialogClosed.bind(this));
	this._observeNotification(oFF.AuMenuEngineToolbarViewPlugin.NOTIFICATION_EXIT_APPLICATION, this._onDataAnalyzerExit.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_FULLSCREEN_TOGGLE, this._onDocumentFullScreenToggle.bind(this));
	this._observeNotification(oFF.HuHorizonInternalNotifications.MESSAGE_MANAGER_NEW_MESSAGE, this._onMessageManagerNewMessage.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerDocumentPlugin.NOTIFICATION_DATA_FETCH_COMPLETE, this._onDataFetchComplete.bind(this));
	this._observeNotification(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_PANELS_READY, this._onPanelsReady.bind(this));
};
