oFF.AuDataAnalyzerExternalApi.prototype._onDataSourceChanged = function(data)
{
	let dataProvider = data.getXObjectByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_NEW_DP);
	let dpName = data.getStringByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_NEW_DP_NAME);
	let daFileObj = data.getXObjectByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_FILE);
	let daFile = daFileObj;
	let isModel = false;
	let isInsight = false;
	if (oFF.XObjectExt.isValidObject(daFile))
	{
		let fileType = data.getStringByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_FILE_TYPE);
		if (oFF.XString.isEqual(fileType, oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_DA_FILE_TYPE_MODEL))
		{
			isModel = true;
		}
		else
		{
			isInsight = true;
		}
	}
	else
	{
		isModel = oFF.XStringUtils.isNotNullAndNotEmpty(this._getDatasetId(dataProvider));
	}
	if (isInsight)
	{
		let insightId = daFile.getAttributes().getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
		oFF.XCollectionUtils.forEach(this.m_insightOpenedCallbacks, (callback) => {
			callback(insightId);
		});
	}
	else if (isModel)
	{
		if (oFF.XObjectExt.isValidObject(daFile))
		{
			oFF.XCollectionUtils.forEach(this.m_modelChangedCallbacks, (callback) => {
				callback(daFile);
			});
		}
	}
	else
	{
		let dataSource = this.m_dataSourceSupplier(dpName);
		this._fireDataSourceChanged(dataSource);
	}
};
oFF.AuDataAnalyzerExternalApi.prototype._onDataSourcePicked = function(data)
{
	if (oFF.isNull(data))
	{
		return;
	}
	let dataSource = data.getXObjectByKey(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATA_DATASOURCE);
	this._fireDataSourceChanged(dataSource);
};
oFF.AuDataAnalyzerExternalApi.prototype._onDirtyStateChanged = function(data)
{
	if (this.m_dirtyStateChangeCallbacks.hasElements() && oFF.notNull(data))
	{
		let newDirtyState = data.getBooleanByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_DIRTY_STATE);
		let isInsight = data.getXObjectByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_FILE) !== null;
		if (isInsight)
		{
			oFF.XCollectionUtils.forEach(this.m_dirtyStateChangeCallbacks, (callback) => {
				callback(newDirtyState);
			});
		}
	}
};
