oFF.AuDataAnalyzerExternalApi.prototype.toggleDimension = function(name, axisType)
{
	let currentDp = this.m_dataSpace.getXObjectByKey(oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_ACTIVE_DATA_PROVIDER_KEY);
	if (oFF.notNull(currentDp))
	{
		let cc = currentDp.getQueryManager().getConvenienceCommands();
		let dim = cc.getDimension(name);
		if (oFF.notNull(dim))
		{
			if (dim.getAxisType() === axisType)
			{
				return currentDp.getActions().getAxisActions().removeDimension(name);
			}
			else
			{
				return currentDp.getActions().getAxisActions().moveDimensionToAxis(name, axisType);
			}
		}
	}
	return oFF.XPromise.reject(oFF.XError.create("Document has no active data provider!"));
};

