oFF.AuMenuActionsProviderCommandPlugin.prototype.registerMenuActions = function(xLocalizationProvider)
{
	if (this.m_areActionsRegistered)
	{
		return oFF.XPromise.resolve(this.m_registrarsList);
	}
	let gdsQueryBuilderAdvancedActionsRegistrar = oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQueryBuilderAdvancedActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQueryBuilderAdvancedActionsRegistrar);
	let gdsQbDimAttrFieldMoveActionsRegistrar = oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbDimAttrFieldMoveActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbDimAttrFieldMoveActionsRegistrar);
	let gdsQbTotalsActionsRegistrar = oFF.AuGdsQbTotalsActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbTotalsActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbTotalsActionsRegistrar);
	let gdsQbSortingActionsRegistrar = oFF.AuGdsQbSortingActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbSortingActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbSortingActionsRegistrar);
	let gdsQbReadModeSuppressionActionsRegistrar = oFF.AuGdsQbReadModeSuppressionActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbReadModeSuppressionActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbReadModeSuppressionActionsRegistrar);
	let gdsQbPresentationActionsRegistrar = oFF.AuGdsQbPresentationActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbPresentationActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbPresentationActionsRegistrar);
	let gdsQbHierarchyActionsRegistrar = oFF.AuGdsQbHierarchyActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbHierarchyActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbHierarchyActionsRegistrar);
	let gdsQbFilterActionsRegistrar = oFF.AuGdsQbFilterActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQbFilterActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQbFilterActionsRegistrar);
	let gdsQueryBuilderBasicActionsRegistrar = oFF.AuGdsQueryBuilderBasicActionsRegistrator.create();
	this.registerMenuActionsSub(gdsQueryBuilderBasicActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsQueryBuilderBasicActionsRegistrar);
	let gdsGlobalActionsRegistrar = oFF.AuGdsGlobalActionsRegistrator.create();
	this.registerMenuActionsSub(gdsGlobalActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(gdsGlobalActionsRegistrar);
	let chartActionsRegistrar = oFF.AuChartActionsRegistrator.create();
	this.registerMenuActionsSub(chartActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(chartActionsRegistrar);
	let vizRendererActionsRegistrar = oFF.AuVizRendererActionsRegistrator.create();
	this.registerMenuActionsSub(vizRendererActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(vizRendererActionsRegistrar);
	if (this.m_loadExperimentalActions)
	{
		let gdsQueryBuilderDevActionsRegistrar = oFF.AuGdsQueryBuilderDevActionsRegistrator.create();
		this.registerMenuActionsSub(gdsQueryBuilderDevActionsRegistrar, xLocalizationProvider);
		this.m_registrarsList.add(gdsQueryBuilderDevActionsRegistrar);
	}
	let daDocumentActionsRegistrar = oFF.AuDaDocumentActionsRegistrator.create();
	this.registerMenuActionsSub(daDocumentActionsRegistrar, xLocalizationProvider);
	this.m_registrarsList.add(daDocumentActionsRegistrar);
	let extensionRegistrationActions = oFF.XList.create();
	extensionRegistrationActions.add(oFF.HuUtils.generateActionId(oFF.AuDaWidgetDesignerExtensionCommandPlugin.PLUGIN_NAME, oFF.AuDaWidgetDesignerExtensionCommandPlugin.CMD_REGISTER_ACTIONS));
	extensionRegistrationActions.add(oFF.HuUtils.generateActionId(oFF.AuComposableDesignerCommandPlugin.PLUGIN_NAME, oFF.AuComposableDesignerCommandPlugin.CMD_REGISTER_ACTIONS));
	let extensionActionsPromise = oFF.XPromiseList.create();
	oFF.XCollectionUtils.forEach(extensionRegistrationActions, (registrationAction) => {
		if (this.m_controller.actionByIdExists(registrationAction))
		{
			extensionActionsPromise.add(this.m_controller.executeActionById(registrationAction, null));
		}
		else
		{
			extensionActionsPromise.add(oFF.XPromise.resolve(null));
		}
	});
	let allResolvedPromise = oFF.XPromise.all(extensionActionsPromise);
	return allResolvedPromise.onThen((extensionRegistrars) => {
		oFF.XCollectionUtils.forEach(extensionRegistrars, (registrarObj) => {
			if (oFF.notNull(registrarObj))
			{
				let customActionsRegistrar = oFF.XObject.castToAny(registrarObj);
				this.registerMenuActionsSub(customActionsRegistrar, xLocalizationProvider);
				this.m_registrarsList.add(customActionsRegistrar);
			}
		});
	}).onCatch((err) => {
		oFF.XLogger.printError(oFF.XStringUtils.concatenate2("Registration of custom actions failed. Reason : ", err.getText()));
	}).onThenExt((empty) => {
		this.m_areActionsRegistered = true;
		return this.m_registrarsList;
	});
};
oFF.AuMenuActionsProviderCommandPlugin.prototype.registerMenuActionsSub = function(registrator, xLocalizationProvider)
{
	let dataApplication = this.m_controller.getProcess().findEntity(oFF.ProcessEntity.DATA_APPLICATION);
	let menuManager = oFF.isNull(dataApplication) ? null : dataApplication.getMenuManager();
	menuManager.registerActions(registrator.getLocalizedActionWrapper(xLocalizationProvider));
};
oFF.AuMenuActionsProviderCommandPlugin.prototype.setupPlugin = function(controller)
{
	this.m_controller = controller;
	this.m_registrarsList = oFF.XList.create();
	this.m_areActionsRegistered = false;
	return null;
};

