oFF.AuDaWidgetDesignerExtensionCommandPlugin.prototype.getLocalizedActionWrapper = function(xLocalizationProvider)
{
	let registry = oFF.CMEMultiActionWrapper.create();
	oFF.XCollectionUtils.forEach(this.m_toolbarItems, (toolbarItem) => {
		let toolbarItemStruct = oFF.PrUtils.asStructure(toolbarItem);
		if (oFF.notNull(toolbarItemStruct) && toolbarItemStruct.hasElements())
		{
			let actionName = toolbarItemStruct.getStringByKey(oFF.AuDaWidgetDesignerExtensionCommandPlugin.ACTION_KEY);
			let triggerAction = oFF.CMEFactory.createTriggerAction();
			triggerAction.setNameProvider((nameContext) => {
				return actionName;
			});
			triggerAction.setTextProvider((textContext) => {
				return xLocalizationProvider.getText(toolbarItemStruct.getStringByKey(oFF.AuDaWidgetDesignerExtensionCommandPlugin.LOCALIZATION_KEY));
			});
			triggerAction.setIconProvider((iconContext) => {
				return toolbarItemStruct.getStringByKey(oFF.AuDaWidgetDesignerExtensionCommandPlugin.ICON);
			});
			triggerAction.setEnabledProvider((enabledContext) => {
				return true;
			});
			triggerAction.setAvailableProvider((availableContext) => {
				return true;
			});
			triggerAction.setTrigger((context) => {
				if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_widgetCatalog))
				{
					this._exportCurrentStateAsAnalyticalWidget();
				}
				else
				{
					this._getControllerInternal().getFreeGenesis().showErrorToast("Path to widget catalog not specified! Cannot export!");
				}
			});
			registry.registerAction(actionName, triggerAction);
		}
	});
	return registry;
};
