oFF.AuDataAnalyzerCommandPlugin.prototype._getInteropMetadata = function(storedInteropMetadata)
{
	return oFF.XPromise.create((resolve, reject) => {
		let externalInteropMetadata = oFF.XObject.castToAny(this.getDataSpace().getXObjectByKey(oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_INTEROP_METADATA_KEY));
		let interopMetadata = oFF.notNull(externalInteropMetadata) ? externalInteropMetadata : storedInteropMetadata;
		if (this._getCurrentFile() !== null && oFF.notNull(interopMetadata))
		{
			let attributes = this._getCurrentFile().getAttributes();
			if (interopMetadata.getBooleanByKeyExt("hyperLinkInterop", false) || attributes.containsKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID))
			{
				resolve(interopMetadata);
			}
			else
			{
				oFF.AuGdsPinnedToStoryUtils.getPinnedStoryMetadata(this._getCurrentFile()).onThen((metadata) => {
					if (oFF.isNull(metadata) || !metadata.containsKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID))
					{
						resolve(null);
					}
					else
					{
						resolve(interopMetadata);
					}
				}).onFinally(() => {
					resolve(null);
				});
			}
		}
		else
		{
			resolve(interopMetadata);
		}
	});
};
