oFF.AuDataAnalyzerCommandPlugin.prototype._setupDataProviderConnection = function(connectionObj)
{
	try
	{
		let connection = oFF.XObject.castToAny(connectionObj);
		let dataProviderName = oFF.XStringUtils.concatenate3(connection.getDataSourceName(), ":", oFF.XGuid.getGuid());
		let controller = this.getController();
		let config = oFF.OlapDataProviderConfiguration.createConfigForEmptyDataProvider(controller.getApplication());
		config.setDataProviderName(dataProviderName);
		config.setStartConnection(connection);
		config.setStartWithFillStrategy(oFF.OlapDataProviderVisualizationFillStrategy.ACTIVE);
		this._activateFeatureToggles();
		config.setRepoDeltaEnabled(true);
		if (!oFF.XCollectionUtils.hasElements(connection.getVisualizations()))
		{
			if (this.m_isComposableUseCase)
			{
				connection.setVisualizations(oFF.OuAnalyticalWidgetUtils.getDefaultVisualizations());
			}
			else
			{
				oFF.AuDataAnalyzerCommandUtils.addVizToConfig(config);
			}
		}
		let defaultSettings = this._getDefaultQmSettings();
		let dataSpace = this.getDataSpace();
		config.getHooks().getServiceConfigCreatedRegister().addBiFunction((dp, serviceConfig) => {
			oFF.AuDaQueryManagerUtils.setDefaultQueryServiceConfigSettings(serviceConfig);
			return null;
		});
		config.getHooks().getBeforeRepoLoadRegister().addBiFunction((dp, repo) => {
			oFF.AuDaQueryManagerUtils.setDefaultQmSettings(dp.getQueryManager(), repo, defaultSettings);
			oFF.AuDaQueryManagerUtils.applyGeneralSetting(this.getProcess(), dp.getQueryManager(), defaultSettings);
			return oFF.AuDataAnalyzerCommandUtils.setDataSourceText(dp, dataSpace);
		});
		config.getHooks().getFinalizeVariablesRegister().prependFunction((dp) => {
			return oFF.AuDataAnalyzerCommandUtils.setSimpleVariables(dp, dataSpace);
		});
		config.getHooks().getFinalizeQueryManagerRegister().addFunction((dp) => {
			return oFF.AuDataAnalyzerCommandUtils.setSimpleEqualFilterList(dp, dataSpace).onThenPromise((res) => {
				return oFF.AuDataAnalyzerCommandUtils.setComplexFilters(dp, dataSpace).onThenPromise((res1) => {
					return oFF.AuDaQueryManagerUtils.finalizeQueryManagerSetup(this.getProcess(), dp.getQueryManager(), defaultSettings).onThenExt((res2) => {
						return null;
					});
				});
			});
		});
		let createData = oFF.XNotificationData.create();
		createData.putXObject(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_PARAM_DATA_PROVIDER_CONFIG, config);
		this.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATA_PROVIDER_CONFIG_CREATED, createData);
		let param = oFF.OuDataProviderCPParam.createForCreateDataProviderWithConfig(config);
		let actionPromise = controller.executeAction(oFF.OuDataProviderCommandPlugin.PLUGIN_NAME, oFF.OuDataProviderCPConstants.CMD_CREATE_DATA_PROVIDER_WITH_CONFIG, param);
		actionPromise.onCatch((error) => {
			controller.addErrorMessage("Error", "Failed to setup data source", error.getText());
			if (error.getErrorType() === oFF.DataProviderErrorType.INVALID_MODEL_TYPE)
			{
				let warningPopup = oFF.AuGdsPopupHelper.createInvalidModelsListPopup(controller.getFreeGenesis(), oFF.XLocalizationCenter.getCenter());
				warningPopup.open();
			}
		});
		return actionPromise;
	}
	catch (err)
	{
		throw oFF.XException.createExceptionForRethrowWithDefault(err, "Invalid data provider connection supplied!");
	}
};
oFF.AuDataAnalyzerCommandPlugin.prototype._setupDataSource = function(dataSourceObj)
{
	try
	{
		let dataSource = oFF.XObject.castToAny(dataSourceObj);
		let notificationData = oFF.XNotificationData.create();
		notificationData.putXObject(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATA_DATASOURCE, dataSource);
		this.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATASOURCE_PICKED, notificationData);
		let connection = oFF.OlapDataProviderConnection.createConnection(this.getApplication());
		connection.setDataSource(dataSource);
		return this._setupDataProviderConnection(connection);
	}
	catch (err)
	{
		throw oFF.XException.createExceptionForRethrowWithDefault(err, "Invalid data source supplied!");
	}
};
