oFF.AuCdLandingPageViewPlugin.prototype._onRecentFileSelected = function(recentFile)
{
	let controller = this.getController();
	controller.setBusy(true);
	let widgetName = recentFile.getName();
	let widgetIdObj = oFF.XStringValue.create(widgetName);
	let getWidgetPromise = controller.executeAction(oFF.AuComposableDesignerCommandPlugin.PLUGIN_NAME, oFF.AuComposableDesignerCommandPlugin.CMD_GET_WIDGET_BY_NAME, widgetIdObj);
	getWidgetPromise.onThenPromise((widget) => {
		let createDpPromise = controller.executeAction(oFF.AuComposableDesignerCommandPlugin.PLUGIN_NAME, oFF.AuComposableDesignerCommandPlugin.CMD_CREATE_DATA_PROVIDER_FROM_WIDGET, widget);
		return createDpPromise.onThen((dataProvider) => {
			let dp = oFF.XObject.castToAny(dataProvider);
			let notificationData = oFF.XNotificationData.create();
			notificationData.putXObject(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_NEW_DP, dp);
			notificationData.putString(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_NEW_DP_NAME, dp.getName());
			notificationData.putString(oFF.AuDataAnalyzerDocumentPlugin.NOTIFICATION_DATA_WIDGET_NAME, widgetName);
			this.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DP_CHANGED, notificationData);
		});
	}).onCatch((error) => {
		controller.addErrorMessage("Error", "Failed to open composable widget.", error.getText());
		this.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerDocumentPlugin.NOTIFICATION_SHOW_LANDING_PAGE, null);
	}).onFinally(() => {
		controller.setBusy(false);
	});
};
