	this.m_landingPage.setCreateNewComposableProcedure(this._launchDataSourcePicker.bind(this));
	this.m_landingPage.setCreateNewModelProcedure(this._launchModelPicker.bind(this));
	this.m_landingPage.setRecentFileSelectedConsumer(this._onRecentFileSelected.bind(this));
