oFF.AuDataAnalyzerLegacyDocumentPlugin.prototype.gatherVisualizationDefinitionsFromConfig = function()
{
	let visDefs = oFF.XList.create();
	let protocolBindings = this.getConfiguration().getListByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS);
	if (!oFF.XCollectionUtils.hasElements(protocolBindings))
	{
		return visDefs;
	}
	for (let i = 0; i < protocolBindings.size(); i++)
	{
		let protocol = protocolBindings.getStructureAt(i);
		let visualizationType = protocol.getStringByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS_TYPE);
		let visualizationPlugin = protocol.getStringByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS_PLUGIN);
		if (!this.getController().getAllAvailableComponentPlugins().contains(visualizationPlugin))
		{
			continue;
		}
		let displayName = protocol.getStringByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS_DISPLAY_NAME);
		let description = protocol.getStringByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS_DESCRIPTION);
		let icon = protocol.getStringByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS_ICON);
		let pluginConfig = protocol.getStructureByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_VISUALIZATIONS_CONFIG);
		let type = oFF.ProtocolBindingType.lookup(visualizationType);
		if (oFF.isNull(type))
		{
			type = oFF.ProtocolBindingType.createCustomProtocolBindingType(visualizationType);
		}
		visDefs.add(oFF.AuDaPluginVisualizationDefinition.createDefinition(type, visualizationType, displayName, description, icon, visualizationPlugin, pluginConfig));
	}
	return visDefs;
};
oFF.AuDataAnalyzerLegacyDocumentPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuPluginCategory.OLAP;
};
