{
	return oFF.AuDataAnalyzerLegacyDocumentPlugin.PLUGIN_NAME;
};
oFF.AuDataAnalyzerLegacyDocumentPlugin.prototype.handleProgramStartup = function(program, visDefs)
{
	let externalApi = program;
	this.getController().getGlobalDataSpace().putXObject(oFF.AuDataAnalyzerLegacyDocumentPlugin.SPACE_EXTERNAL_API, externalApi);
	let activeDocument = externalApi.getActiveDocument();
	if (activeDocument.getDocumentType() === oFF.AuGdsDocumentType.QUERY_BUILDER)
	{
		let qbExternalApi = activeDocument;
		for (let i = 0; i < visDefs.size(); i++)
		{
			let visDef = visDefs.get(i);
			this.getController().newComponentPlugin(visDef.getPluginName(), visDef.getPluginConfig(), null).onThen((iconViewId) => {
				qbExternalApi.registerCustomView(visDef.getName(), visDef.getDisplayName(), visDef.getDescription(), visDef.getIcon(), () => {
					return this.getController().getPluginView(iconViewId);
				});
			});
		}
	}
};
oFF.AuDataAnalyzerLegacyDocumentPlugin.prototype.layoutDocument = function(documentController)
{
	let genesis = documentController.getGenesis();
	let content = genesis.newControl(oFF.UiType.CONTENT_WRAPPER);
	content.useMaxSpace();
	let runner = oFF.ProgramRunner.createRunner(this.getController().getProcess(), "GalaxyDataStudio");
	runner.setContainerType(oFF.ProgramContainerType.CONTENT);
	runner.setAnchorContentControl(content);
	let config = documentController.getConfiguration();
	let dataAnalyzerConfig = config.getByKey(oFF.AuDataAnalyzerLegacyDocumentPlugin.PARAM_DATA_ANALYZER_CONFIG);
	let configString = oFF.PrUtils.serialize(dataAnalyzerConfig, false, false, 0);
	runner.setStringArgument(oFF.AuGdsConstants.PARAM_GDS_CONFIGURATION, configString);
	runner.setStringArgument(oFF.AuGdsConstants.PARAM_DOC_TYPE, oFF.AuGdsDocumentType.QUERY_BUILDER.getName());
	runner.setStringArgument(oFF.AuGdsConstants.PARAM_INTEGRATION, "sac");
	runner.setStringArgument(oFF.AuGdsConstants.PARAM_LAUNCH_QUICK_ACTION, config.getStringByKey(oFF.AuGdsConstants.PARAM_LAUNCH_QUICK_ACTION));
	runner.setBooleanArgument(oFF.AuGdsConstants.PARAM_HIDE_MENU_BAR, true);
	runner.setBooleanArgument(oFF.AuGdsConstants.PARAM_HIDE_STATUS_BAR, true);
	runner.setStringArgument(oFF.AuGdsConstants.PARAM_TOOL_NAME, "Data Analyzer");
	runner.setBooleanArgument(oFF.AuGdsConstants.PARAM_MULTI_DOCUMENTS, false);
	runner.setBooleanArgument(oFF.AuGdsConstants.PARAM_QUERY_BUILDER_AUTO_OPEN_DATA_SOURCE_PICKER, oFF.XString.isEqual(config.getStringByKey(oFF.AuGdsConstants.PARAM_LAUNCH_QUICK_ACTION), oFF.AuGdsConstants.PARAM_DATASOURCE));
	runner.setBooleanArgument(oFF.AuGdsConstants.PARAM_QUERY_BUILDER_MULTI_VIEWS, false);
	runner.setBooleanArgument(oFF.AuGdsConstants.PARAM_ADVANCED_FEATURES, false);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_SHOW_WELCOME_DIALOG);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_PROCESS_URL_PARAMS);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_AUTO_SUBMIT);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_FORCE_REPO_FORMAT);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_HIDE_MENU_BAR);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_QUERY_BUILDER_MULTI_VIEWS);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_MULTI_DOCUMENTS);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_DEBUG);
	this.copyBooleanArgument(runner, oFF.AuGdsConstants.PARAM_SHOW_SAC_SHORTCUT_EXPLANATORY_DIALOG);
	this.copyStringArgument(runner, oFF.DfProgram.PARAM_FILE);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_GDS_CONFIGURATION_FILE);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_FILE_CONTENT);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_SYSTEM);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_DATASOURCE);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_RRI_NAME);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_RRI_VALUE);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_MODEL);
	this.copyStringArgument(runner, oFF.AuGdsConstants.PARAM_TOOL_NAME);
	let visDefs = this.gatherVisualizationDefinitionsFromConfig();
	this.getController().setRoot(content);
	runner.runProgram().onThen((program) => {
		this.m_gdsProgram = program;
		this.handleProgramStartup(program, visDefs);
	}).onCatch((err) => {
		this.getController().setRoot(genesis.newControl(oFF.UiType.LABEL).setText(err.getText()));
	});
};

