{
	return oFF.HuPluginCategory.OTHER;
};
oFF.AuDaLandingPageViewPlugin.prototype.getPluginName = function()
{
	return oFF.AuDaLandingPageViewPlugin.PLUGIN_NAME;
};
oFF.AuDaLandingPageViewPlugin.prototype.setupPlugin = function(controller)
{
	oFF.HuDfComponentPlugin.prototype.setupPlugin.call( this , controller);
	return null;
};

