oFF.AuOlapDesignerDocumentPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuPluginCategory.OLAP;
};
oFF.AuOlapDesignerDocumentPlugin.prototype.getPluginName = function()
{
	return oFF.AuOlapDesignerDocumentPlugin.PLUGIN_NAME;
};
oFF.AuOlapDesignerDocumentPlugin.prototype.layoutDocument = function(documentController)
{
	let genesis = documentController.getGenesis();
	this.m_layout = genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	this.m_layout.useMaxSpace();
	this.m_layout.addItem(this.m_inventoryView);
	this.m_layout.addItem(this.m_builderView);
	this.getController().setRoot(this.m_layout);
};
oFF.AuOlapDesignerDocumentPlugin.prototype.setupPlugin = function(controller)
{
	oFF.HuDfDocumentPlugin.prototype.setupPlugin.call( this , controller);
	this._observeNotifications();
	let configuration = this.getConfiguration();
	let inventoryConfig = this._getInventoryPluginConfig(configuration);
	return this._createViewPlugin(oFF.AuOlapInventoryViewPlugin.PLUGIN_NAME, inventoryConfig, true).onThenPromise((inventoryView) => {
		this.m_inventoryView = inventoryView;
		let builderConfig = this._getBuilderPluginConfig(configuration);
		return this._createViewPlugin(oFF.AuOlapAxesBuilderViewPlugin.PLUGIN_NAME, builderConfig, false).onThenExt((builderView) => {
			this.m_builderView = builderView;
			return oFF.XBooleanValue.create(true);
		});
	});
};

