oFF.AuDataAnalyzerDocumentPlugin.prototype._closeDocument = function()
{
	if (this._getDirtyState() && oFF.XStringUtils.isNotNullAndNotEmpty(this.m_widgetName))
	{
		let localization = oFF.XLocalizationCenter.getCenter();
		let title = localization.getText(oFF.XCommonI18n.WARNING);
		let question = localization.getText(oFF.AuComposableDesignerI18n.BACK_NAVIGATION_UNSAVED_CHANGES_CONFIRMATION_TEXT);
		let confirmationPopup = oFF.UtConfirmPopup.create(this.getGenesis(), title, question);
		confirmationPopup.setConfirmButtonText(localization.getText(oFF.XCommonI18n.SAVE));
		confirmationPopup.setConfirmButtonType(oFF.UiButtonType.PRIMARY);
		let discardText = localization.getText(oFF.XCommonI18n.DISCARD);
		confirmationPopup.setCancelButtonText(discardText);
		confirmationPopup.setConfirmProcedure(() => {
			this._saveDocument().onThen((widget) => {
				this._returnToLandingPage();
			});
		});
		confirmationPopup.setCancelProcedure(this._returnToLandingPage.bind(this));
		confirmationPopup.open();
	}
	else
	{
		this._returnToLandingPage();
	}
};
