oFF.AuDataAnalyzerDocumentPlugin.prototype._createDataProviderFromInterop = function()
{
	let controller = this.getController();
	let clipboard = this.getProcess().getClipboard();
	let clipboardReadPromise = clipboard.read();
	let createDpPromise = clipboardReadPromise.onThenPromise((content) => {
		if (oFF.notNull(content) && content.isJsonContentSet())
		{
			let jsonContent = content.getJsonContent();
			if (oFF.notNull(jsonContent) && jsonContent.isStructure())
			{
				let interopContent = jsonContent.asStructure();
				return controller.executeAction(oFF.AuDaContentHandlerCommandPlugin.PLUGIN_NAME, oFF.AuDaContentHandlerCommandPlugin.CMD_CREATE_DATA_PROVIDER_FROM_INTEROP_CONTENT, interopContent);
			}
		}
		throw oFF.XException.createException("No valid interop content found in clipboard to create a data provider.");
	});
	return createDpPromise.onThenPromise((dpObj) => {
		let dp = oFF.XObject.castToAny(dpObj);
		this.m_activeDpName = dp.getName();
		return oFF.OuDataProviderCommandPlugin.runRegisterExistingDataProviderAction(controller, this.m_activeDpName, dp);
	}).onCatch((err) => {
		oFF.XLogger.println("No interop content supplied! Landing page will be shown to the user.");
	}).onThen((result1) => {
		clipboard.clear();
	});
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._createDocumentLayout = function()
{
	try
	{
		let controllerBase = oFF.XObject.castToAny(this.getController());
		return controllerBase.createNewLayoutManager(this._getDocumentLayoutConfig()).onThenExt((qbLayoutManager) => {
			this.m_documentLayout = qbLayoutManager.getView();
			if (qbLayoutManager.getLayoutType() === oFF.HuLayoutType.WORKSPACE)
			{
				let queryBuilderLayout = oFF.XObject.castToAny(qbLayoutManager.getActivePluginLayout());
				this._setupDocumentLayout(queryBuilderLayout);
			}
			return this.m_documentLayout;
		});
	}
	catch (e)
	{
		throw oFF.XException.createIllegalStateException(oFF.XException.getMessage(e));
	}
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._createInitialDataProvider = function()
{
	if (this.m_isComposableUseCase)
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_widgetCatalog))
		{
			if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_widgetName))
			{
				return this._createDataProviderByWidgetName(this.m_widgetName);
			}
			else if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_systemName) && oFF.XStringUtils.isNotNullAndNotEmpty(this.m_dataSource))
			{
				let dataSource = oFF.QFactory.createDataSource();
				dataSource.setSystemName(this.m_systemName);
				dataSource.setFullQualifiedName(this.m_dataSource);
				return this._createDataProviderFromDataSource(dataSource);
			}
		}
		return this._createDataProviderFromInterop();
	}
	else
	{
		if (oFF.notNull(this.m_initialDpConfig))
		{
			return this._createDataProviderFromConfig(this.m_initialDpConfig);
		}
		return oFF.XPromise.resolve(null);
	}
};
