oFF.AuDataAnalyzerDocumentPlugin.prototype._displayIllustratedErrorMessage = function(message)
{
	let errorLayout = this.m_rootWrapper.setNewContent(oFF.UiType.FLEX_LAYOUT);
	errorLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	errorLayout.setJustifyContent(oFF.UiFlexJustifyContent.CENTER);
	errorLayout.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	errorLayout.useMaxSpace();
	let illustratedMessage = errorLayout.addNewItemOfType(oFF.UiType.ILLUSTRATED_MESSAGE);
	illustratedMessage.setIllustrationType(oFF.UiIllustratedMessageType.CONNECTION);
	illustratedMessage.setIllustrationSize(oFF.UiIllustratedMessageSize.AUTO);
	let msgStrip = errorLayout.addNewItemOfType(oFF.UiType.MESSAGE_STRIP);
	msgStrip.setMessageType(oFF.UiMessageType.ERROR);
	msgStrip.setShowCloseButton(false);
	msgStrip.setShowIcon(true);
	msgStrip.setIcon("message-error");
	msgStrip.setText(oFF.XStringUtils.isNotNullAndNotEmpty(message) ? message : "Error");
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._executeForceRefresh = function()
{
	let dataProvider = this.getDataProvider();
	let fetchResultSetPromise = dataProvider.getResulting().fetchNewResultSet(oFF.AuDataAnalyzerDocumentPlugin.FORCE_REFRESH_EVENT_CORRELATION_ID);
	fetchResultSetPromise.onThen((messages) => {
		let modelChangeEvent = dataProvider.getEventing().getEmitterForModelChanges().newTypedEvent();
		modelChangeEvent.setCorrelationId(oFF.AuDataAnalyzerDocumentPlugin.FORCE_REFRESH_EVENT_CORRELATION_ID);
		modelChangeEvent.queue();
	});
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._executeResetToInitial = function()
{
	this._showEmptyLoadingPage();
	let actions = this.getDataProvider().getActions();
	actions.startActionChainWithId(oFF.AuUndoManager.UNDO_REDO_EVENT_CORRELATION_ID);
	actions.getLifecycleActions().reconnectDataProvider(true).onFinally(() => {
		this.m_undoManager.resetUndoRedo();
		this._showDocumentView();
		actions.endActionChain();
	});
};
