oFF.AuDataAnalyzerDocumentPlugin.prototype._getDocumentLayoutConfig = function()
{
	let qbTemplatePath;
	if (this.m_isComposableUseCase)
	{
		qbTemplatePath = oFF.XStringUtils.concatenate2(oFF.AuDataAnalyzerDocumentPlugin.TEMPLATE_CD_RESOURCE_PATH, oFF.AuDataAnalyzerDocumentPlugin.TEMPLATE_CD_QUERY_BUILDER_FILENAME);
	}
	else
	{
		qbTemplatePath = oFF.XStringUtils.concatenate2(oFF.AuDataAnalyzerDocumentPlugin.TEMPLATE_DA_RESOURCE_PATH, oFF.AuDataAnalyzerDocumentPlugin.TEMPLATE_DA_QUERY_BUILDER_FILENAME);
	}
	let documentConfig = oFF.XResourcesExt.loadJson(qbTemplatePath);
	oFF.HuHorizonConfigUtils.setConfigProperty(documentConfig, oFF.AuMenuEngineToolbarViewPlugin.PLUGIN_NAME, oFF.AuMenuEngineToolbarViewPlugin.CONFIG_SHOW_EXIT_WIDGET, oFF.PrBoolean.createWithValue(this._isExitWidgetVisible()));
	oFF.HuHorizonConfigUtils.setConfigProperty(documentConfig, oFF.AuOlapDesignerDocumentPlugin.PLUGIN_NAME, oFF.AuOlapDesignerDocumentPlugin.CONFIG_IS_FOR_VIZ_INSTANCE, oFF.PrBoolean.createWithValue(this.m_chartRenderingVizInstance));
	oFF.HuHorizonConfigUtils.setConfigProperty(documentConfig, oFF.AuOlapDesignerDocumentPlugin.PLUGIN_NAME, oFF.AuOlapInventoryViewPlugin.CONFIG_ENABLE_CALCULATIONS_GEN_AI, oFF.PrBoolean.createWithValue(this.m_isCalculationsGenAiEnabled));
	this._setDocumentGeneralInfoViewPluginConfig(documentConfig);
	this._setChartStylePropertiesPluginConfig(documentConfig);
	let pluginDefIterator = oFF.HuHorizonConfigUtils.getPluginDefinitionIterator(documentConfig);
	while (pluginDefIterator.hasNext())
	{
		let currentPluginDefinition = pluginDefIterator.next();
		if (oFF.notNull(currentPluginDefinition) && currentPluginDefinition.isStructure())
		{
			let currentPluginDefinitionStructure = currentPluginDefinition.asStructure();
			this.m_pluginManager.enhancePluginStartConfig(currentPluginDefinitionStructure);
		}
	}
	return documentConfig;
};
