oFF.AuDataAnalyzerDocumentPlugin.prototype._observeNotifications = function()
{
	let controller = this.getController();
	let notificationCenter = controller.getLocalNotificationCenter();
	this.m_dpChangedObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DP_CHANGED, (data) => {
		if (this.m_isComposableUseCase)
		{
			this.m_rootWrapper.setBusy(true);
			this.m_activeDpName = data.getStringByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_NEW_DP_NAME);
			this.m_widgetName = data.getStringByKey(oFF.AuDataAnalyzerDocumentPlugin.NOTIFICATION_DATA_WIDGET_NAME);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_widgetName))
			{
				oFF.OuAnalyticalWidgetUtils.getWidgetByName(this.getProcess(), this.m_widgetName, this.m_widgetCatalog).onThen((widget) => {
					this._setAsActiveWidget(widget);
					this._showDocumentView();
				}).onCatch((err) => {
					controller.addErrorMessage("Error", oFF.XStringUtils.concatenate2("Could not load widget with name: ", this.m_widgetName), err.getText());
					this._returnToLandingPage();
				});
			}
			else
			{
				this._showDocumentView();
			}
		}
		else
		{
			let newDpName = data.getStringByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_NEW_DP_NAME);
			let daFile = data.getXObjectByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_FILE);
			let afterDpChangedProcedure = data.getXObjectByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_AFTER_DP_CHANGED_PROCEDURE);
			this._setCurrentFile(daFile);
			this._switchDataProvider(newDpName).onThen((empty) => {
				if (oFF.notNull(afterDpChangedProcedure))
				{
					afterDpChangedProcedure.execute();
				}
			});
		}
	});
	this.m_inventoryVisibilityToggleObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_INVENTORY_VISIBILITY_TOGGLED, (data) => {
		data.getBooleanByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_IS_INVENTORY_VISIBLE);
		let isInventoryPanelVisible = data.getBooleanByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_IS_INVENTORY_VISIBLE);
		if (oFF.notNull(this.m_splitterManager))
		{
			this.m_splitterManager.setInventoryPanelVisibility(isInventoryPanelVisible);
		}
		else
		{
			this.logDebug("Splitter manager is not initialized. Cannot change inventory panel visibility.");
		}
	});
	this.m_exportDataObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_START_EXPORT, (data) => {
		let config = data.getXObjectByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_DATA_EXPORT_CONFIG);
		this.m_exportManager.exportData(config.getType(), config);
	});
	this.m_filterLineVisibilityObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_SET_FILTER_LINE_VISIBILITY, (data) => {
		let value = data.getBooleanByKey(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_FILTER_LINE_VISIBLE);
		this._setFilterLineVisible(value);
	});
	this.m_showLandingPageObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerDocumentPlugin.NOTIFICATION_SHOW_LANDING_PAGE, (data) => {
		this._showLandingPageView().onThen((status) => {
			this.getLocalNotificationCenter().postNotificationWithName(oFF.AuDataAnalyzerNotificationConstants.NOTIFICATION_LANDING_PAGE_OPENED, null);
		});
	});
	this.m_dataProviderConfigCreatedObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATA_PROVIDER_CONFIG_CREATED, this._onDataProviderConfigCreated.bind(this));
	this.m_dataSourcePickedObserverId = notificationCenter.addObserverForName(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_DATASOURCE_PICKED, (dataX) => {
		this._showEmptyLoadingPage();
	});
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._onAfterSave = function(savedArtifact)
{
	if (this.m_isComposableUseCase)
	{
		let savedWidget = oFF.XObject.castToAny(savedArtifact);
		this._setAsActiveWidget(savedWidget);
		this._markDocumentAsPristine();
		this._updateToolbar();
		this.getGenesis().showAlert("Composable widget saved!", oFF.XStringUtils.concatenate2("Widget Name : ", this.m_widgetName), oFF.UiValueState.SUCCESS);
	}
	else
	{
		let file = oFF.XObject.castToAny(savedArtifact);
		this._getContent().onThen((content) => {
			this._setCurrentFile(file);
			this._markDocumentAsPristine();
			this._updateToolbar();
			let insightId = file.getAttributes().getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
			this._notifyInsightSaved(content, insightId);
			this._removeInsightMigrationWarningIfPresent();
			let isSaveAndPinInsight = this.getGlobalDataSpace().getBooleanByKey(oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_INSIGHT_PINNED_KEY);
			let message = isSaveAndPinInsight ? this._getText(oFF.AuGdsQueryBuilderI18n.SAVE_AND_PIN_INSIGHT_SUCCESS) : this._getText(oFF.AuGalaxyDataStudioI18n.SAVE_INSIGHT_SUCCESS);
			this._showSuccessToast(message);
		});
	}
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._onDataProviderConfigCreated = function(data)
{
	let config = data.getXObjectByKey(oFF.AuDataAnalyzerCommandPlugin.NOTIFICATION_PARAM_DATA_PROVIDER_CONFIG);
	if (oFF.isNull(config))
	{
		return;
	}
	this.m_variableCallbackId = config.getHooks().getFinalizeVariablesRegister().addFunction((dataProvider) => {
		config.getHooks().getFinalizeVariablesRegister().removeFunctionByUuid(this.m_variableCallbackId);
		this.m_variableCallbackId = config.getHooks().getFinalizeVariablesRegister().prependFunction((dp) => {
			return this.m_variableManager.openVariableDialogPromiseIfNecessary();
		});
		this.m_variableManager.setDataProvider(dataProvider);
		if (this._forcePrompt())
		{
			return this.m_variableManager.openInitialVariableDialogPromiseIfPossible();
		}
		return this.m_variableManager.openInitialVariableDialogPromiseIfNecessary();
	});
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._onDataSpaceChanged = function(key)
{
	let dataSpace = this.getGlobalDataSpace();
	let dataProvider = this.getDataProvider();
	if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_OPEN_PANELS_STATE_KEY))
	{
		let newPanelState = dataSpace.getXObjectByKey(oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_OPEN_PANELS_STATE_KEY);
		let openPanelKey = this._getOpenPanelKey(newPanelState);
		let data = oFF.XNotificationData.create();
		data.putString(oFF.HpSideNavigationDocumentPlugin.NOTIFICATION_DATA_PANEL_KEY, openPanelKey);
		data.putBoolean(oFF.HpSideNavigationDocumentPlugin.NOTIFICATION_DATA_PANEL_VISIBILITY, oFF.XStringUtils.isNotNullAndNotEmpty(openPanelKey));
		this.getLocalNotificationCenter().postNotificationWithName(oFF.HpSideNavigationDocumentPlugin.NOTIFICATION_CHANGE_PANEL_VISIBILITY, data);
	}
	else if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_SPLITTER_CONTENT_STATE_KEY))
	{
		let panelContentState = dataSpace.getXObjectByKey(oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_SPLITTER_CONTENT_STATE_KEY);
		if (oFF.notNull(this.m_splitterManager))
		{
			this.m_splitterManager.setSplitterState(panelContentState);
		}
		else
		{
			this.logDebug("Splitter manager is not initialized. Cannot set splitter state.");
		}
	}
	else if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_FILTER_LINE_VISIBLE_KEY))
	{
		if (oFF.notNull(this.m_qbWorkspaceLayout))
		{
			this.m_qbWorkspaceLayout.setPluginVisibility(oFF.AuOlapFilterLineViewPlugin.PLUGIN_NAME, this._isFilterLineVisible());
			this._updateToolbar();
			let notificationData = oFF.XNotificationData.create();
			notificationData.putBoolean(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_DATA_IS_VISIBLE, this._isFilterLineVisible());
			this.getLocalNotificationCenter().postNotificationWithName(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_SET_VISIBILITY, notificationData);
		}
		else
		{
			this.logDebug("Query Builder Workspace Layout is not initialized. Cannot set filter line visibility.");
		}
	}
	else if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_DATASOURCE_TEXT_KEY))
	{
		oFF.AuDataAnalyzerCommandUtils.setDataSourceText(dataProvider, dataSpace);
	}
	else if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_FILTERS_KEY))
	{
		oFF.AuDataAnalyzerCommandUtils.setSimpleEqualFilterList(dataProvider, dataSpace);
	}
	else if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_EXTERNAL_VARIABLES_KEY))
	{
		oFF.AuDataAnalyzerCommandUtils.setSimpleVariables(dataProvider, dataSpace);
	}
	else if (oFF.XString.isEqual(key, oFF.AuDataAnalyzerCommandPlugin.DATA_SPACE_COMPLEX_FILTERS_KEY))
	{
		oFF.AuDataAnalyzerCommandUtils.setComplexFilters(dataProvider, dataSpace);
	}
};
