oFF.AuDataAnalyzerDocumentPlugin.prototype._save = function(actionName)
{
	let controller = this.getController();
	controller.setBusy(true);
	let savePromise;
	if (this.m_isComposableUseCase)
	{
		let isSaveOperation = oFF.XString.isEqual(actionName, oFF.AuComposableDesignerCommandPlugin.CMD_SAVE_DOCUMENT);
		let existingWidget = isSaveOperation ? this._getCurrentAnalyticalWidget() : null;
		let showPopupPromise = oFF.OuAnalyticalWidgetExportUtils.presentWidgetExportFormPopup(this.getGenesis(), existingWidget, this.m_widgetCatalog);
		savePromise = showPopupPromise.onThenPromise((modelJson) => {
			return controller.executeAction(oFF.AuComposableDesignerCommandPlugin.PLUGIN_NAME, actionName, modelJson).onThen(this._onAfterSave.bind(this)).onCatch((error) => {
				let errorText1 = error.getText();
				if (oFF.XStringUtils.isNotNullAndNotEmpty(errorText1))
				{
					this._showErrorToast(oFF.XStringUtils.concatenate2("An error occurred: ", errorText1));
					controller.addErrorMessage("Error", "Failed to save widget.", errorText1);
				}
			});
		});
	}
	else
	{
		savePromise = controller.executeAction(oFF.AuDataAnalyzerCommandPlugin.PLUGIN_NAME, actionName, null).onThen(this._onAfterSave.bind(this)).onCatch((error) => {
			let errorText2 = error.getText();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(errorText2))
			{
				let errMsg = this._getText(oFF.AuGalaxyDataStudioI18n.SAVE_INSIGHT_AUTH_ERROR);
				this._showErrorToast(errMsg);
				controller.addErrorMessage("Error", "Failed to save insight", errorText2);
			}
		});
	}
	return savePromise.onFinally(() => {
		controller.setBusy(false);
	});
};
oFF.AuDataAnalyzerDocumentPlugin.prototype._saveDocument = function()
{
	if (this.m_isComposableUseCase)
	{
		let saveAction = oFF.XStringUtils.isNotNullAndNotEmpty(this.m_widgetName) ? oFF.AuComposableDesignerCommandPlugin.CMD_SAVE_DOCUMENT : oFF.AuComposableDesignerCommandPlugin.CMD_SAVE_DOCUMENT_AS;
		return this._save(saveAction);
	}
	else
	{
		let saveAction = this._hasFile() ? oFF.AuDataAnalyzerCommandPlugin.CMD_SAVE_DOCUMENT : oFF.AuDataAnalyzerCommandPlugin.CMD_SAVE_DOCUMENT_AS;
		if (this._shouldShowInsightMigrationWarning())
		{
			return this._presentMigrateSaveWarningDialog();
		}
		else
		{
			return this._save(saveAction);
		}
	}
};
