	this.m_quickShareManager = oFF.XObjectExt.release(this.m_quickShareManager);
	this.m_generalSettings = null;
	this.m_infoPanelConfig = null;
	this.m_systemName = null;
	this.m_dataSource = null;
	this.m_widgetCatalog = null;
	this.m_widgetName = null;
	this.m_initialDpConfig = null;
	this._releaseDataProvider(this.m_activeDpName);
	this.m_activeDpName = null;
	this.m_emptyPage = oFF.XObjectExt.release(this.m_emptyPage);
	this.m_splitterManager = null;
	this.m_qbWorkspaceLayout = null;
