oFF.AuOlapAxesBuilderViewPlugin.prototype._observeNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	this.m_vizNameSetObserverId = notificationCenter.addObserverForName(oFF.AuOlapAxesBuilderViewPlugin.NOTIFICATION_VISUALIZATION_NAME_SET, (data) => {
		this.m_visualizationName = data.getStringByKey(oFF.AuOlapAxesBuilderViewPlugin.CONFIG_VISUALIZATION_NAME);
		this._setActiveVisualization(this.m_visualizationName);
	});
	this.m_displayTypeChangeObserverId = notificationCenter.addObserverForName(oFF.AuOlapAxesBuilderViewPlugin.NOTIFICATION_DISPLAY_TYPE_VISIBILITY_CHANGE, (data) => {
		let showDisplayType = data.getBooleanByKey(oFF.AuOlapAxesBuilderViewPlugin.CONFIG_SHOW_DISPLAY_TYPE);
		if (this.m_showDisplayType !== showDisplayType)
		{
			this.m_showDisplayType = showDisplayType;
			this.m_view.setDisplayTypeVisibility(this.m_showDisplayType);
		}
	});
	this.m_toggleInventoryBtnObserverId = notificationCenter.addObserverForName(oFF.AuOlapAxesBuilderViewPlugin.NOTIFICATION_TOGGLE_PRESS_INVENTORY_BUTTON, (data) => {
		let pressInventoryViewButton = data.getBooleanByKey(oFF.AuOlapAxesBuilderViewPlugin.NOTIFICATION_DATA_PRESSED);
		this.m_showInventoryToggleBtn.setPressed(pressInventoryViewButton);
	});
	this.m_expandDimensionId = notificationCenter.addObserverForName(oFF.AuOlapAxesBuilderViewPlugin.NOTIFICATION_EXPAND_DIMENSION, this.onExpandDimensionNotification.bind(this));
	this.m_expandMemberId = notificationCenter.addObserverForName(oFF.AuOlapAxesBuilderViewPlugin.NOTIFICATION_EXPAND_MEMBER, this.onExpandMemberNotification.bind(this));
	this.m_dragStartObserverId = this.m_dragDropHelper.addDragStartListener(this.onDragStart.bind(this));
	this.m_dragEndObserverId = this.m_dragDropHelper.addDragEndListener(this.onDragEnd.bind(this));
};
oFF.AuOlapAxesBuilderViewPlugin.prototype._setActiveVisualization = function(activeVizName)
{
	let activeDataProvider = this.getDataProvider();
	if (oFF.notNull(activeDataProvider))
	{
		let promise = activeDataProvider.getActions().getVisualizationActions().getVisualizationChartType(activeVizName);
		promise.onThen((chartType) => {
			let displayType = oFF.OuAxesViewDisplayType.lookup(chartType.getName());
			this.m_view.setDisplayTypeForVisualization(displayType, activeVizName);
		}).onCatch((error) => {
			this.m_view.setDisplayTypeForVisualization(oFF.OuAxesViewDisplayType.GRID, activeVizName);
		});
	}
};
oFF.AuOlapAxesBuilderViewPlugin.prototype._unobserveNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	notificationCenter.removeObserverByUuid(this.m_vizNameSetObserverId);
	this.m_vizNameSetObserverId = null;
	notificationCenter.removeObserverByUuid(this.m_displayTypeChangeObserverId);
	this.m_displayTypeChangeObserverId = null;
	notificationCenter.removeObserverByUuid(this.m_toggleInventoryBtnObserverId);
	this.m_toggleInventoryBtnObserverId = null;
	notificationCenter.removeObserverByUuid(this.m_expandDimensionId);
	this.m_expandDimensionId = null;
	notificationCenter.removeObserverByUuid(this.m_expandMemberId);
	this.m_expandMemberId = null;
	this.m_dragDropHelper.removeDragStartListener(this.m_dragStartObserverId);
	this.m_dragStartObserverId = null;
	this.m_dragDropHelper.removeDragEndListener(this.m_dragEndObserverId);
	this.m_dragEndObserverId = null;
};
