oFF.AuOlapAxesBuilderViewPlugin.prototype.validateDragModel = function(model)
{
	let queryManager = this.m_view.getDataProvider() !== null ? this.m_view.getDataProvider().getQueryManager() : null;
	if (oFF.isNull(queryManager))
	{
		return false;
	}
	if (!oFF.OlapUiDimensionUtil.isDimension(model) && !oFF.OlapUiDimensionUtil.isMemberNode(model) && !oFF.OlapUiDimensionUtil.isAttribute(model))
	{
		return false;
	}
	let dimContext = model;
	return queryManager.getQueryModel().getDimensionByName(dimContext.getDimension().getName()) !== null;
};

