oFF.AuOlapInventoryViewPlugin.prototype.setupPlugin = function(controller)
{
	oFF.DfOuDataProviderComponentPlugin.prototype.setupPlugin.call( this , controller);
	this.m_presentationType = oFF.QueryPresentationUtils.DESCRIPTION;
	this.m_viewConfiguration = oFF.OuInventoryViewConfiguration.createInventoryViewConfig(this.getController().getApplication());
	let configuration = controller.getConfiguration();
	this.m_isInDualPanelMode = configuration.getBooleanByKey(oFF.AuOlapDesignerDocumentPlugin.CONFIG_IS_IN_DUAL_PANEL_MODE);
	this.m_viewConfiguration.setShowGroupPresentationMenu(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_SHOW_GROUP_MENU));
	this.m_viewConfiguration.setShowGroupExpandCollapseOptions(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_GROUP_EXPAND_COLLAPSE));
	this.m_viewConfiguration.setCalculationsEnabled(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_ENABLE_CALCULATIONS));
	this.m_viewConfiguration.setCalculationsGenAiEnabled(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_ENABLE_CALCULATIONS_GEN_AI));
	this.m_viewConfiguration.setCalculationsOnSecondaryStructEnabled(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_ENABLE_CALCULATIONS));
	this.m_viewConfiguration.setShowCustomDimension2(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_SHOW_CUSTOM_DIMENSION2));
	this.m_viewConfiguration.setShowDimensionMoreButton(configuration.getBooleanByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_SHOW_DIMENSION_MORE_BUTTON));
	let presentationString = configuration.getStringByKey(oFF.AuOlapInventoryViewPlugin.CONFIG_DEFAULT_GROUP_PRESENTATION);
	let presentation = oFF.OuInventoryViewGroupPresentation.lookup(presentationString);
	this.m_viewConfiguration.setDefaultGroupPresentation(presentation);
	this.m_viewConfiguration.setChartingPhase2Enabled(true);
	this.m_viewConfiguration.setDefaultPresentation(this.m_presentationType);
	this.m_dragDropHelper = oFF.OuDragDropHelper.createHelper(controller.getProcess());
	return oFF.XPromise.resolve(oFF.XBooleanValue.create(true));
};

